import React from "react";
import { useEffect } from "react";
import { useState } from "react";
import "../css/projects.css"

const ShowPage = () =>{

    const [data, SetData] = useState([]);

    useEffect(() => {
        fetch("Projects.json")
            .then(res => {console.log(res); res.json()})
            .then(json => {
                SetData(json) 
            })
    }, [])

    return(
    <div>
        <table>
            <tbody>
                {
                    data.map(project => {
                        return(
                            <tr>
                                <td className="project-title">{project.Title}</td>
                                <td className="project-anchor"><a href={project.Link}> Click Here</a></td>
                                <td className="project-img"><img ref={`Media/${project.Img}`} /></td>
                            </tr>
                        )
                    })
                }
            </tbody>
        </table>
    </div>
    )
}

export default ShowPage;
